BootstrapVars.areaInformation = [
    {
        layerGroupName: "agency",
        htmlInfo: "<div class='gridSetDescriptions'><div><h2>City and County</h2> <div>Local government lands data (lands owned by Washingtons 39 counties and more than 280 cities and towns) were sourced from the <a href='http://depts.washington.edu/wagis/projects/parcels/index.php'>2012 Washington State Parcel Database</a>. The parcel database obtained the local jurisdiction data directly from county auditor offices or other local records-keeping officials. </div> <h2><strong>Federal</strong></h2> <div>Federal lands data were sourced from multiple providers via the <a href='http://depts.washington.edu/wagis/projects/parcels/index.php'>Washington State Parcel Database</a>. Providers include the U.S. Bureau of Land Management, the Defense Installations Spatial Data Infrastructure, the U.S. Fish and Wildlife Service, the National Park Service, and the U.S. Forest Service.</div> <h2>Washington Department of Natural Resources</h2> <div>The data for <span lang='EN'>the Washington</span> Department of Natural Resource managed lands (aquatic and uplands) were derived from the combination of a land inventory system and land transaction database. This information is subject to changes over time, and the Web application map may not always reflect the most up-to-date information. The ownership layer shows fee simple lands of the Department of Natural Resources. For landscape-specific maps and other Geographic Information System data, visit our <a target='_blank' href='http://www.dnr.wa.gov/Pages/default.aspx'>Web site </a></div> <h2>Washington Department of Fish and Wildlife</h2> <div>Washington Department of Fish and Wildlifes data on acquisition projects were obtained from its real estate records and Lands Information System. The Washington Department of Fish and Wildlife stores information on more than 5,000 real estate transactions, dating back to the Department of Game and Fisheries in the 1930s. The Washington Department of Fish and Wildlife<span lang='EN'> does not have a public Web interface of its real estate transactions.</span></div> <h2><span lang='EN'>Washington State Parks</span></h2> <div><span lang='EN'>State Parks data on land acquisitions were extracted from its Land Inventory database, which compiles records of all the land donations, purchases, and management agreements that have built the park system over the last century. The acquisition boundaries and land use information were sourced from the agency Geographic Information System. State Parks has a </span><a target='_blank' href='http://www.parks.wa.gov/'>Web site</a> where the public can find maps and additional information on the various natural, cultural, recreational, artistic, and interpretive experiences available at each park.</div></div>",
        startDate: '2003',
        endDate: '2014',
        titleInfo:'About This Data&mdash;Owner Map'
    },
    {
        layerGroupName: "landtypes",
        htmlInfo: "<div class='gridSetDescriptions'><div>The land use categories are identified for state agency lands only. Although recreation and natural resource lands usually encompass several uses, one principal land use is identified here. </div> <div>Washington Department of Fish and Wildlife, Department of Natural Resources, and State Parks have different missions and policies for acquiring and disposing of lands, and they have different in-house categories of land use. Each state agency determined the principal use of its land parcels. </div> <div>Principal use is defined as follows: </div> <h2>Conservation</h2> <div>Conservation lands, as defined here, provide habitat for rare animals and plants. </div> <h2>Developed Recreation</h2> <div>Developed recreation lands may include developed parks, campgrounds, playgrounds, boat launches, ball fields, shooting ranges, and many other outdoor recreational activities that require infrastructure.&nbsp; </div> <h2>Habitat and Passive Recreation</h2> <div>Habitat and passive recreation lands include wildlife areas and open space. These lands provide places for plants and animals as well as outdoor recreational activities, such as hiking, hunting, and wildlife viewing, which require access but no specialized infrastructure. </div> <h2>Other</h2> <div>Other state lands include agency administrative sites, Washington Department of Fish and Wildlife hatcheries, and areas that do not fit in the other categories listed here. </div> <h2>Revenue Generation</h2> <div>Lands that produce revenue for the state include state-managed trust lands, timber lands, agriculture lands, lands leased for communication towers, and other working lands. The inventory includes only surface ownership, not other associated rights (e.g., mineral rights, water rights, development rights).</div></div>",
        startDate: '2003',
        endDate: '2014',
        titleInfo:'About This Data&mdash;Land Use Map'
    },
    {
        layerGroupName: "acquisitions",
        htmlInfo: "<div class='gridSetDescriptions'> <div>Acquisitions are shown for state agencies only, for the period 2003 to 2014. Zoom in to see parcel <span lang='EN'>outlines. </span></div> <div>Click on a parcel for the following information:</div> <h2><span class='h2header'>Parcel ID</span></h2> <div>Unique identifier provided by the contributing agency.</div> <h2><span class='h2header'>Owner</span></h2> <div>Washington Department of Fish and Wildlife, Washington Department of Natural Resources, or State Parks.</div> <h2><span class='h2header'>Ownership Type:</span></h2> <div>Ownership is assigned to the agency holding the title; in most cases this is fee simple ownership. Note that conservation and agricultural easements on private land purchased with public funds are tallied at the county level, but they are not shown on the map to protect the landowners privacy.</div> <h2><span class='h2header'>Total Area (Acres)</span></h2> <div>As reported by the agency contributing the data.</div> <h2><span class='h2header'>Principal Land Use</span></h2> <div>Defined as Conservation; Developed Recreation; Habitat and Passive Recreation; Other; or Revenue Generation. See About This Data for the Land Use Map for more detail.</div> <h2><span class='h2header'>Acquisition Year</span></h2> <div>Defined as the year the current owner acquired the land.</div> <h2><span class='h2header'>Acquisition Cost</span></h2> <div>Data includes only the purchase price; it does not cover the costs of personnel time, agency overhead costs, or incidentals associated with the acquisitions, nor does it necessarily include the entire match provided by partners involved with an acquisition, such as volunteer time or in-kind contributions. </div> <div>When land was acquired or disposed of through a land exchange, the acquisition cost is shown as zero.</div> <div>For detail on acquisitions funded by programs administered by the Recreation and Conservation Office (RCO), enable the RCO Grants button. </div><div></div></div>",
        startDate: '2003',
        endDate: '2014',
        titleInfo:'About This Data&mdash;Acquisitions Map'
    },
    {
        layerGroupName: "proposed",
        htmlInfo: "<div class='gridSetDescriptions'> <div>Proposed acquisitions are shown for state agencies only, as reported in the 2014 Habitat and Recreation Lands Coordinating Groups State Land Acquisition Forecast Report. </div> <br><div>The goal of the forecast report is to provide information about planned state land purchases and disposals to help citizens, legislators, and state agencies make informed decisions.  It is also intended to encourage better coordination and communication among state agencies. The projects in the forecast report are unfunded at the time the report is published and the data provided is based on best estimates at the time.</div><br><div>More information on the lands group and the forecast report are available online at:<a target='_blank' href='http://www.rco.wa.gov/boards/hrlcg.shtml'> http://www.rco.wa.gov/boards/hrlcg.shtml</a></div>",
        startDate: '2003',
        endDate: '2014',
        titleInfo:'About This Data&mdash;Proposed Acquistions'
    }
];



